import React from "react";

export default function TrackSearchResult({ track }) {
  console.log(track.albumUrl);
  return (
    <div className="d-flex m-2 align-items-center">
      <img src={track.albumUrl} style={{ height: "64px", width: "64px" }} />
      <div className="ml-3">
        <div>{track.title}</div>
      </div>
    </div>
  );
}
